PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX brick: <https://brickschema.org/schema/Brick/>
PREFIX ashrae: <http://data.ashrae.org/standard223#>

SELECT DISTINCT ?zone ?zoneLabel ?propLabel ?alcEndpoint ?mpcEndpoint
WHERE {
  # Zones (targets)
  ?zone a ashrae:Zone .
  OPTIONAL { ?zone rdfs:label ?zoneLabel . }

  # Properties associated with the zone
  ?zone ashrae:hasProperty ?prop .
  ?prop rdfs:label ?propLabel .

  # Exclude writable properties
  FILTER NOT EXISTS { ?prop brick:writable true }

  # Optional ALC (generic) endpoint reference
  OPTIONAL { ?prop brick:endpoint ?alcEndpoint . }

  # Optional MPC (database name) endpoint reference
  OPTIONAL { ?prop brick:mpc_db_name ?mpcEndpoint . }
}
ORDER BY ?zone ?propLabel
